import PrimaryCard from './UI/PrimaryCard';
import Items from '../common-components/Items'
import ItemsHandler from '../common-components/ItemsHandler'
import { MdPeople , MdPeopleOutline } from 'react-icons/md';
import './teamspp.css'
function TeamsPP(){
    return(
        <PrimaryCard className="TeamsPP-card">
            <div className="TeamsPP-header">
                <label>Teams</label>
            </div>
            <div className="TeamsPP-wrapper"></div>
            <div className="CreateTeams-wrapper">
                <span>
                    <label className="CreateTeams__label"><Item iconA={<MdPeopleOutline/>} iconB={Md}/>Join or create a team</label>
                    <i className="CreateTeams__i"></i>
                </span>
            </div>
        </PrimaryCard>
    );
}

export default TeamsPP;
